import Aux from '../../../hoc/Aux';

const summaryBrick=(props)=>{

    return(
        <Aux>
            <p>{props.counterBrick}</p>
            {props.children}
            <button onClick={props.clicked}>Publish</button>
        </Aux>
    );
}

export default summaryBrick;
